import React from 'react';
import { Link } from 'react-router-dom';
import './navBar.css';

function NavBar() {
  return (
    <div className="navBar">
      <Link to="/">Home</Link>
      <Link to="/podcasts">Podcasts</Link>
      <Link to="/guests">Guests</Link>
    </div>
  );
}

export default NavBar;
